<Ukrainian>:
Завдання місії:
 - Захопіть та втримайте аеродром;
 - Захопіть та втримуйте перевагу в повітряній зоні.

<Hungarian>:
[Operation] játékmódban a csapatoknak különféle feladatokat kell teljesíteniük a győzelem érdekében.

Küldetés céljai:
– semmisítsd meg a megjelölt földi célpontokat;
– semmisítsd meg az ellenség bázisait;
– semmisítsd meg az ellenség repülőterét.

[Frontvonal] játékmódban a csapatoknak különféle feladatokat kell teljesíteniük a frontvonalnál a győzelem érdekében.

Küldetés céljai:
– semmisítsd meg a megjelölt földi célpontokat;
– semmisítsd meg az ellenség bázisait;
– semmisítsd meg az ellenség repülőterét.

Küldetés céljai:
– bombázd le az ellenség bázisát;
– semmisítsd meg az ellenséges járműveket.
